import React, {Component} from 'react';
import './App.css';
import {CardList} from './components/card-list/card-list.component'

class App extends Component {
  constructor(){
    super()
    this.state={
      monsters:[
        {name:'Frankenstein'},
        {name:'Mummy'},
        {name:'Ghost'},

      ]

    }
  }
  render() {
    return(
    <div className="App">

    {
      this.state.monsters.map(monster=><CardList> {monster.name} </CardList>)
    }
    </div>
    )
  }
}

export default App;
